import style from './MainContentAuth.module.css';

const MainContentAuth = () => {
    return (
        <main className={style['main-auth']}>
        <h1 className={style['welcome-text']}>Welcome back!</h1>
        <div className={style['auth']}>Welcome back!</div>
        </main>
    )
}

export default MainContentAuth
